import React from 'react';
import Button from './Button';

const CalcualtorButtons = props => {
  const buttonClicked = e => {
    this.props.buttonClicked(e.target.value);
  };
  return (
    <div style={styles}>
      <>
        <Button item="7" itemType="number" value={7} onClick={buttonClicked} />
        <Button item="8" itemType="number" value={8} />
        <Button item="9" itemType="number" value={9} />
        <Button item="DEL" itemType="operator" />
      </>
      <>
        <Button item="4" itemType="number" value={4} />
        <Button item="5" itemType="number" value={5} />
        <Button item="6" itemType="number" value={6} />
        <Button item="+" itemType="operator" value={'+'} />
      </>
      <>
        <Button item="1" itemType="number" value={1} />
        <Button item="2" itemType="number" value={2} />
        <Button item="3" itemType="number" value={3} />
        <Button item="*" itemType="operator" value={'*'} />
      </>
      <>
        <Button item="." itemType="operator" value={'.'} />
        <Button item="0" itemType="number" value={0} />
        <Button item="=" itemType="operator" value={'='} />
        <Button item="-" itemType="operator" value={'-'} />
      </>
    </div>
  );
};

const styles = {
  display: 'flex',
  flexWrap: 'wrap',
  alignItems: 'center',
  justifyContent: 'center',
  textAlign: 'center',
  alignContent: 'center',
  height: '80%'
};
export default CalcualtorButtons;
